import React from 'react';
import API from '../../service/homeservice';
const _ = require('lodash');

class Cart extends React.Component {
    constructor(props) {
        console.log("props Home======", props);
        super(props);
        this.state = {

        }

    }

    componentDidMount() {
        const value = localStorage.getItem('productId');
        const val = _.uniq(value.split(',')); //dplicate value remove
        console.log('value of token-=-=', val);
        const filter = _.filter(val, _.size); // null value remove
        console.log('value of filter-=-=', filter[0]);
        for(var i=0; i<=filter.length;i++){
            API.productDetail(filter[i]).
            then((findresponse) => {
                this.state.isFetching = false;
                console.log("productDetail response===", findresponse);
            }).catch(
                { status: 500, message: 'Internal Server Error' }
            );
        }
    }

    render() {


        return (
            <div>
                <h1>Hello</h1>
            </div>
        );
    }
}

export default Cart;
